import React from 'react'
import BGTexture from '../images/round.png';

export default function Resume() {
    return (
        <div style={{ backgroundImage: `url(${BGTexture})` }}>
            <iframe title="resume" src="https://resume.creddle.io/embed/j9dv8z8noze"
                width="850" height="1100" seamless></iframe>
        </div>
    )
}
